// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.1;

import "./IGridCell.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/introspection/IERC165.sol";

//Grid 'CELL' token contract
contract GridCell is IGridCell, ERC721Enumerable, AccessControlEnumerable {
    bytes32 public constant ROLE_OWNER = keccak256("ROLE_OWNER");
    bytes32 public constant ROLE_OPERATOR = keccak256("ROLE_OPERATOR");
    bytes32 public constant ROLE_CORE_CONTRACT = keccak256("ROLE_CORE_CONTRACT");
    bytes32 public constant ROLE_STAKE_DENYLIST = keccak256("ROLE_STAKE_DENYLIST");

    /// @dev The total staked amount for each team
    uint256[8] private teamTotalStake;

    /// @dev The total earned amount for each team
    uint256[8] private teamTotalEarnings;

    /// @dev The total earned amount for each team, per stake
    uint256[8] private teamTotalEarningsPerStake;

    /// @dev Store the value of the team's earnings last time the CELL made a claim
    mapping (uint256 => uint256) private cellIdToLastTeamTotalEarningsPerStake;

    struct Cell {
        uint256 id;
        int32[2] coordinates;
        uint256 properties;
        uint8 team;
    }

    //all our CELLs live here
    Cell[] public grid;

    //The Discovery event is fired whenever a new CELL is added to The Grid
    event Discovery(uint256 indexed cellId, int32[2] coordinates, uint256 properties, uint8 team, address owner);
    event TeamChange(uint256 indexed cellId, uint8 teamOld, uint8 indexed teamNew, uint64 timestamp);

    constructor() ERC721("Grid Cell", "CELL") {
        _setupRole(ROLE_OWNER, msg.sender);
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    /// We don't want someone to be able to accidentally send funds to this contract so we 
    /// ensure the fallback function is not payable
    fallback() external {}

    //introspect yourself, fool
    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721Enumerable, IERC165, AccessControlEnumerable) returns (bool) {
        return interfaceId == type(IGridCell).interfaceId || super.supportsInterface(interfaceId);
    }

    //generate a new CELL!
    function createCell(uint256 _initialProperties, uint8 _initialTeam, address _initialOwner) public override returns (uint256 _cellId) {
        require(
            hasRole(ROLE_OPERATOR, msg.sender) || hasRole(ROLE_CORE_CONTRACT, msg.sender), 
            "Only an OPERATOR and the core contract can call createCell()"
        );

        require(_initialOwner != address(0), "CELL can't be minted to zero address");

        //get the total number of existing CELLs in the Grid (before this one is created)
        uint256 _tokenCount = totalSupply();

        uint256 _properties = _initialProperties;

        //unless an operator is generating a unique/special CELL, properties will be randomised
        if (_properties == 0) {
            _properties = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, _tokenCount)));
        }

        Cell memory _newCell = Cell({
            id: _tokenCount + 1,
            coordinates: _getCoordinates(_tokenCount),
            properties: _properties,
            team: _initialTeam
        });

        grid.push(_newCell);

        //create the NFT
        _safeMint(_initialOwner, _newCell.id);

        //inform the world of the newest discovered CELL!
        emit Discovery(_newCell.id, _newCell.coordinates, _newCell.properties, _newCell.team, _initialOwner);

        return _newCell.id;
    }

    //retrieve details of a CELL identified by its ID
    function getCell(uint256 _cellId) external view override returns (
            uint256 cellId, 
            int32[2] memory coordinates, 
            uint256 properties, 
            uint8 team, 
            address owner
        ) {
        require(
            _cellId > 0 && _cellId <= totalSupply(),
            "No CELL exists with this ID"
        );

        Cell storage cell = grid[_cellId - 1];

        return (_cellId, cell.coordinates, cell.properties, cell.team, ownerOf(_cellId));
    }

    function getCellLastTeamEarningsPerStake(uint256 _cellId) external view override returns (uint256 lastTotalEarningsPerStake) {
        return cellIdToLastTeamTotalEarningsPerStake[_cellId];
    }

    function getCellGrade(uint256 _cellId, uint256 _properties) public pure override returns (uint8 _grade) {
        bytes32 _propertiesBytes = bytes32(_properties);

        //create a number from 0 to 2^16 out of the second and third bytes
        uint16 _gradeProperties = uint16(_propertiesBytes[1] | bytes2(_propertiesBytes[2] << 8));

        //set a default grade then check if this Cell is special
        _grade = 0;

        //central Cell has a higher grade than any other
        if (_cellId == 1) {
            _grade = 4;
        //1% of cells are Deluxe quality (as well as all Cells within the second central cartographical square)
        } else if (_cellId <= 9 || _gradeProperties <= 650) {
            _grade = 3;
        //5% of cells are Premium quality (as well as all Cells within the third central cartographical square)
        } else if (_cellId <= 25 || _gradeProperties <= 3250) {
            _grade = 2;
        //10% of cells are Standard+ quality (as well as all Cells within the fourth central cartographical square)
        } else if (_cellId <= 49 || _gradeProperties <= 9830) {
            _grade = 1;
        }

        return _grade;
    }

    function getStake(uint8 _grade) public pure override returns (uint8) {
        //Perfect grade = 10x mining speed
        if (_grade == 4) {
            return 10;
        //Deluxe grade = 5x mining speed
        } else if (_grade == 3) {
            return 5;
        //Premium grade = 2x mining speed
        } else if (_grade == 2) {
            return 2;
        }

        //default = 1x mining speed
        return 1;
    }

    function getTeamEarnings(uint8 team) external view override returns (uint256 teamEarnings, uint256 teamEarningsPerStake) {
        require(team >= 0 && team < 8, "Invalid team");

        return (teamTotalEarnings[team], teamTotalEarningsPerStake[team]);
    }

    function getTeamStake(uint8 team) external view override returns (uint256 teamStake) {
        require(team >= 0 && team < 8, "Invalid team");

        return teamTotalStake[team];
    }

    function getAllTeamEarnings() external view override returns (uint256[8] memory teamEarnings, uint256[8] memory teamEarningsPerStake) {
        return (teamTotalEarnings, teamTotalEarningsPerStake);
    }

    function getAllTeamStakes() external view override returns (uint256[8] memory teamStake) {
        return teamTotalStake;
    }

    //update the CELL's team
    function setTeam(uint256 _cellId, uint8 _newTeam) external override onlyRole(ROLE_CORE_CONTRACT) {
        require(
            _cellId > 0 && _cellId <= totalSupply(),
            "No CELL exists with this ID"
        );

        Cell storage cell = grid[_cellId - 1];

        //remove this CELL's stake from its old team
        uint8 _grade = getCellGrade(cell.id, cell.properties);
        uint8 _stake = getStake(_grade);

        teamTotalStake[cell.team] -= _stake;

        require(cell.team != _newTeam, "CELL is already on this team");

        //add this new CELL's stake to its new team
        teamTotalStake[_newTeam] += _stake;

        //mark the point at which this CELL started earning for this new team
        cellIdToLastTeamTotalEarningsPerStake[_cellId] = teamTotalEarningsPerStake[_newTeam];

        emit TeamChange(_cellId, cell.team, _newTeam, uint64(block.timestamp));

        cell.team = _newTeam;
    }

    function setAllTeamEarnings(
        uint256[8] memory _newTeamTotalEarnings, 
        uint256[8] memory _newTeamTotalEarningsPerStake
    ) external override onlyRole(ROLE_CORE_CONTRACT) {
        require(
            _newTeamTotalEarnings[0] >= teamTotalEarnings[0] &&
            _newTeamTotalEarnings[1] >= teamTotalEarnings[1] &&
            _newTeamTotalEarnings[2] >= teamTotalEarnings[2] &&
            _newTeamTotalEarnings[3] >= teamTotalEarnings[3] &&
            _newTeamTotalEarnings[4] >= teamTotalEarnings[4] &&
            _newTeamTotalEarnings[5] >= teamTotalEarnings[5] &&
            _newTeamTotalEarnings[6] >= teamTotalEarnings[6] &&
            _newTeamTotalEarnings[7] >= teamTotalEarnings[7] &&
            _newTeamTotalEarningsPerStake[0] >= teamTotalEarningsPerStake[0] &&
            _newTeamTotalEarningsPerStake[1] >= teamTotalEarningsPerStake[1] &&
            _newTeamTotalEarningsPerStake[2] >= teamTotalEarningsPerStake[2] &&
            _newTeamTotalEarningsPerStake[3] >= teamTotalEarningsPerStake[3] &&
            _newTeamTotalEarningsPerStake[4] >= teamTotalEarningsPerStake[4] &&
            _newTeamTotalEarningsPerStake[5] >= teamTotalEarningsPerStake[5] &&
            _newTeamTotalEarningsPerStake[6] >= teamTotalEarningsPerStake[6] &&
            _newTeamTotalEarningsPerStake[7] >= teamTotalEarningsPerStake[7],
            "New earning values must exceed previous values"
        );

        teamTotalEarnings = _newTeamTotalEarnings;
        teamTotalEarningsPerStake = _newTeamTotalEarningsPerStake;
    }

    //allow the core contract to update a CELL's last earnings marker during a claimGridTokens() call
    function updateCellLastTeamEarningsPerStake(uint256 _cellId) external override onlyRole(ROLE_CORE_CONTRACT) {
        _updateCellLastTeamEarningsPerStake(_cellId);
    }

    //this will be called any time a CELL is minted, transferred or claims its tokens
    function _updateCellLastTeamEarningsPerStake(uint256 _cellId) private {
        require(
            _cellId > 0 && _cellId <= totalSupply(),
            "No CELL exists with this ID"
        );

        Cell storage cell = grid[_cellId - 1];

        //mark the point at which the owner started earning from this CELL (since last claim or transfer)
        cellIdToLastTeamTotalEarningsPerStake[_cellId] = teamTotalEarningsPerStake[cell.team];
    }

    /// @dev Hook that is called before any token transfer (includes minting and burning)
    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual override {
        super._beforeTokenTransfer(from, to, tokenId);

        bool _fromAllowStake = (
            from != address(0) &&
            !hasRole(ROLE_CORE_CONTRACT, from) &&
            !hasRole(ROLE_STAKE_DENYLIST, from)
        );

        bool _toAllowStake = (
            to != address(0) &&
            to != 0x000000000000000000000000000000000000dEaD &&
            !hasRole(ROLE_CORE_CONTRACT, to) &&
            !hasRole(ROLE_STAKE_DENYLIST, to)
        );

        /*  add or remove this CELL's stake from its team under these conditions/examples:
            from 0 to CORE 			(from NO to NO)     = no action
            from CORE to AUCTION	(from NO to NO)     = no action
            from AUCTION to USER	(from NO to YES)    = add stake
            from USER to AUCTION	(from YES to NO)    = subtract stake
            from USER to USER	    (from YES to YES)   = no action
        */
        Cell storage cell = grid[tokenId - 1];
        uint8 _grade = getCellGrade(tokenId, cell.properties);

        if (!_fromAllowStake && _toAllowStake) {
            teamTotalStake[cell.team] += getStake(_grade);
        } else if (_fromAllowStake && !_toAllowStake) {
            teamTotalStake[cell.team] -= getStake(_grade);
        }

        //reset the claim marker
        _updateCellLastTeamEarningsPerStake(tokenId);
    }

    //let's implement our own square root function because solidity doesn't like math
    function _sqrt(uint256 _x) private pure returns (uint256 _y) {
        uint256 _z = (_x + 1) / 2;

        _y = _x;

        while (_z < _y) {
            _y = _z;
            _z = ((_x / _z) + _z) / 2;
        }
    }

    //CELL placement will be ordered in an Ulam spiral
    //this function will be called only when discovering a new CELL since we don't want to have to compute co-ordinates for every usage
    function _getCoordinates(uint256 _cell_index) private pure returns (int32[2] memory _coordinates) {
        //start from 0,0 and spiral outwards
        if (_cell_index == 0) {
            return [int32(0), int32(0)];
        }

        uint256 _rooted = _sqrt(_cell_index);

        //I could try to name these variables in a more meaningful way, but it won't really help
        //Just trust the math for the Ulam function
        int32 _step1 = int32(int256(_rooted)) - 1;
        int32 _r = (_step1 / 2) + 1;
        int32 _p = (8 * _r * (_r - 1)) / 2;
        int32 _d = _r * 2;
        int32 _a = (int32(int256(_cell_index)) - _p) % (_r * 8);
        int32 _o = _a / _d;

        if (_o == 0) {
            return [_a - _r, -_r];
        } else if (_o == 1) {
            return [_r, (_a % _d) - _r];
        } else if (_o == 2) {
            return [_r - (_a % _d), _r];
        } else if (_o == 3) {
            return [-_r, _r - (_a % _d)];
        }
    }
}
